import gsap from 'gsap/all';
import React, { useEffect } from 'react';

import './css/AboutMe.css';

function AboutMe() {
  useEffect(() => {
    gsap.to('.a', {
      x: 400,
      rotation: 360,
      duration: 3
    });
  });
  return (
    <>
      <div className="box a"></div>
      <div className="box b"></div>
      <div className="box c"></div>
    </>
  );
}

export default AboutMe;
